fn calculate_known_word_cost(&self, feature_weight: f64) -> i16 { let scaled_weight = (feature_weight * cost_constants::KNOWN_WORD_COST_MULTIPLIER) as i32; let final_cost = cost_constants::KNOWN_WORD_BASE_COST as i32 + scaled_weight; final_cost.clamp( cost_constants::KNOWN_WORD_COST_MIN as i32, cost_constants::KNOWN_WORD_COST_MAX as i32 ) as i16
} // Unknown word cost calculation
fn calculate_unknown_word_cost(&self, feature_weight: f64, category: usize) -> i32 { let base_cost = cost_constants::UNK_BASE_COST; let category_adjustment = match category { 0 => cost_constants::UNK_DEFAULT_ADJUSTMENT, 1 => cost_constants::UNK_HIRAGANA_ADJUSTMENT, 2 => cost_constants::UNK_KATAKANA_ADJUSTMENT, 3 => cost_constants::UNK_KANJI_ADJUSTMENT, 4 => cost_constants::UNK_ALPHA_ADJUSTMENT, 5 => cost_constants::UNK_NUMERIC_ADJUSTMENT, _ => 0, }; let scaled_weight = (feature_weight * cost_constants::UNK_COST_MULTIPLIER) as i32; let final_cost = base_cost + category_adjustment + scaled_weight; final_cost.clamp( cost_constants::UNK_COST_MIN, cost_constants::UNK_COST_MAX )
}

